DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `insertPoint`(IN mlatitude DOUBLE,IN mlongtitude DOUBLE,IN maltitude DOUBLE,IN mtrip_id CHAR(20),IN mprovince CHAR(30),IN mcity CHAR(30),IN mposition_id CHAR(20))
BEGIN
DECLARE cityid INT DEFAULT 0;
IF(LENGTH(trim(mprovince))>1 AND LENGTH(trim(mcity))>1)
THEN
	SELECT city_id INTO cityid FROM city WHERE province = mprovince AND city = mcity;
	IF (cityid = 0)
	THEN
		SELECT city_id INTO cityid FROM city WHERE province = mprovince AND city = mcity;
	END IF;
END IF;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for lockBike
-- ----------------------------
DROP PROCEDURE IF EXISTS `lockBike`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `lockBike`(IN mbikeId INT,IN mtripid CHAR(20))
BEGIN
DECLARE mpositionid CHAR(20) DEFAULT "";
DECLARE mpositionid2 CHAR(20) DEFAULT "";
UPDATE bike SET statues = 'lock' WHERE bike_id = mbikeId;
SELECT position_id INTO mpositionid FROM trace WHERE trip_id = mtripid ORDER BY position_id DESC LIMIT 0,1;
SELECT position_id INTO mpositionid2 FROM trace WHERE trip_id = mtripid ORDER BY position_id ASC LIMIT 0,1;
UPDATE trip SET end_time = NOW(),endPoint=mpositionid,startPoint=mpositionid2 WHERE trip_id = mtripid;
UPDATE bike SET position_id = mpositionid WHERE bike_id = mbikeId;
END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `setTripInfo`;
DELIMITER ;;
CREATE TRIGGER `setTripInfo` BEFORE UPDATE ON `trip` FOR EACH ROW BEGIN
DECLARE tmplat DOUBLE DEFAULT 0;
DECLARE newlat DOUBLE DEFAULT 0;
DECLARE tmplon DOUBLE DEFAULT 0;
DECLARE newlon DOUBLE DEFAULT 0;
DECLARE totlen DOUBLE DEFAULT 0; 
DECLARE tmplen DOUBLE DEFAULT 0;
DECLARE tottime DOUBLE DEFAULT 0;
DECLARE uphills INT DEFAULT 0;
DECLARE downhills INT DEFAULT 0;
DECLARE tmpalt DOUBLE DEFAULT 0;
DECLARE newalt DOUBLE DEFAULT 0;
DECLARE ontheup INT DEFAULT 0;
DECLARE tripid VARCHAR(20);
DECLARE flag INT DEFAULT 0;

DECLARE cur CURSOR FOR (
SELECT latitude,longitude,altitude
FROM ((SELECT trip.trip_id,position_id 
FROM trip  NATURAL JOIN trace) AS temp)
NATURAL JOIN position 
WHERE temp.trip_id=new.trip_id
);
DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET flag=1;
OPEN cur;
WHILE flag!=1 DO
  FETCH cur INTO tmplat,tmplon,tmpalt;
  IF flag!=1 THEN
  FETCH cur INTO newlat,newlon,newalt;
    IF (ontheup!=-1) THEN
			IF(tmpalt-newalt>=4) THEN
			SET downhills=downhills+1;
      SET ontheup=-1;
			END IF;
		END IF;
		IF (ontheup!=1) THEN
			IF(tmpalt-newalt<=-4) THEN
			SET uphills=uphills+1;
			SET ontheup=1;
			END IF;
		END IF;

  SET tmplen=SQRT(
     (((newlon-tmplon)*PI()*12656*cos(((newlat+tmplat)/2)*PI()/180)/180)  
     *  
     ((newlon-tmplon)*PI()*12656*cos (((newlat+tmplat)/2)*PI()/180)/180))  
     +  
     (((newlat-tmplat)*PI()*12656/180)  
     *  
     ((newlat-tmplat)*PI()*12656/180))  
     );
  SET totlen=totlen+tmplen;
  END IF;
END WHILE;
SET new.uphill_times=uphills,new.downhill_times=downhills;
SET new.total_length=totlen;
SET tottime=TIMESTAMPDIFF(SECOND,new.start_time,new.end_time)/3600;
IF (tottime=0) THEN
SET new.avg_speed=0;
ELSE
SET new.avg_speed=totlen/tottime;
END IF;
SET new.calories=new.avg_speed*60*1.05*tottime; 
CLOSE cur;
END
;;
DELIMITER ;
